// Home page
import React from "react";
import { BrowserRouter as Router, Route, Routes, Link } from "react-router-dom";

import Patient from "./pages/Patient.js";
import Login from "./Login.js";
//import { useEffect, useState } from "react";

function Home() {
  return (
    <div className="Home">
      <h2>Welcome to Progenics!</h2>
      <h6>Please navigate below</h6>
      <Router>
        <Routes>
          <Route path="/" element={<Home />} /> {/* The "/" means this is route for the main entry point of website */}
          <Route path="/patient" element={<Patient />} />
        </Routes>
        <Link to="/patient">Submit Registration Form</Link>
      </Router>
    </div>
  );
}

export default Home;
